describe("Low/High Track Tests",function(){var c="low-high-slider";var a="low-high-slider-styled";var b;describe("Single-value sliders, no styling",function(){var d=c;beforeEach(function(){b=$("#testSlider1").slider({id:d,min:0,max:10,value:5})});it("low track width is zero",function(){var e=$("#"+d+" .slider-track-low");expect($(e).css("width")).toBe("0px")});it("high track width is 50%",function(){var f=$("#"+d+" .slider-track-high");var e=f.parent().width();expect($(f).css("width")).toBe((e/2)+"px")});it("high track is transparent",function(){var f=$("#"+d+" .slider-track-high");var g=f.css("background-color");var e=g.match(/rgba\([0-9]{1,3}, [0-9]{1,3}, [0-9]{1,3}, 0\)/);expect(e).toBeTruthy()});afterEach(function(){if(b){b.slider("destroy");b=null}})});describe("Single-value sliders, with styling",function(){var d=a;beforeEach(function(){b=$("#testSlider1").slider({id:d,min:0,max:10,value:5})});it("low track width is zero",function(){var e=$("#"+d+" .slider-track-low");expect($(e).css("width")).toBe("0px")});it("high track width is 50%",function(){var f=$("#"+d+" .slider-track-high");var e=f.parent().width();expect($(f).css("width")).toBe((e/2)+"px")});it("high track is red",function(){var e=$("#"+d+" .slider-track-high");var f=e.css("background-color");expect(f).toBe("rgb(255, 0, 0)")});afterEach(function(){if(b){b.slider("destroy");b=null}})});describe("Range sliders, no styling",function(){var e=c;var d={min:0,max:10,values:[4,6]};beforeEach(function(){b=$("#testSlider1").slider({id:e,min:d.min,max:d.max,range:true,value:d.values})});it("low track width is correct",function(){var h=$("#"+e+" .slider-track-low");var g=h.parent().width();var f=((d.values[0]-d.min)/(d.max-d.min))*g;expect($(h).css("width")).toBe(f+"px")});it("high track width is correct",function(){var h=$("#"+e+" .slider-track-high");var g=h.parent().width();var f=((d.max-d.values[1])/(d.max-d.min))*g;expect($(h).css("width")).toBe(f+"px")});it("low track is transparent",function(){var f=$("#"+e+" .slider-track-low");var h=f.css("background-color");var g=h.match(/rgba\([0-9]{1,3}, [0-9]{1,3}, [0-9]{1,3}, 0\)/);expect(g).toBeTruthy()});it("high track is transparent",function(){var g=$("#"+e+" .slider-track-high");var h=g.css("background-color");var f=h.match(/rgba\([0-9]{1,3}, [0-9]{1,3}, [0-9]{1,3}, 0\)/);expect(f).toBeTruthy()});afterEach(function(){if(b){b.slider("destroy");b=null}})});describe("Range sliders, with styling",function(){var e=a;var d={min:0,max:10,values:[4,6]};beforeEach(function(){b=$("#testSlider1").slider({id:e,min:d.min,max:d.max,range:true,value:d.values})});it("low track width is correct",function(){var h=$("#"+e+" .slider-track-low");var g=h.parent().width();var f=((d.values[0]-d.min)/(d.max-d.min))*g;expect($(h).css("width")).toBe(f+"px")});it("high track width is correct",function(){var h=$("#"+e+" .slider-track-high");var g=h.parent().width();var f=((d.max-d.values[1])/(d.max-d.min))*g;expect($(h).css("width")).toBe(f+"px")});it("low track is green",function(){var f=$("#"+e+" .slider-track-low");var g=f.css("background-color");expect(g).toBe("rgb(0, 255, 0)")});it("high track is red",function(){var f=$("#"+e+" .slider-track-high");var g=f.css("background-color");expect(g).toBe("rgb(255, 0, 0)")});afterEach(function(){if(b){b.slider("destroy");b=null}})})});